-module(seq).
-author("Wyatt").
-import(lists,[droplast/1,append/2,sum/1,nth/2,reverse/2,sublist/2,sublist/3,delete/2,nthtail/2]).
%% API
-export([doARow/2,add/2,getSecond/3,startMultiplication4x4/0,startMultiplication10x10/0,startMultiplication50x50/0,startMultiplication100x100/0,splitBack/5]).

% multiplies two rows together
doARow([],[]) ->
  [];
doARow([First|Rest], [First2|Rest2])->
  [First * First2 | doARow(Rest,Rest2)].

% sums the result from the multiplication
add(List,List2) ->
  FirstElement = doARow(List,List2),
  sum(FirstElement).

% gets the second list for matrix multiplication
getSecond(Matrix2,0,I) ->
  [];
getSecond(Matrix2,LengthOfMatrix2,I) ->
  [nth(I,nth(LengthOfMatrix2,Matrix2))| getSecond(Matrix2,LengthOfMatrix2-1,I)].

% calls the add function (i.e starts matrix multiplication)
run(Matrix,Matrix2, I, 0,N) ->
  [];
run(Matrix,Matrix2, I, Last,N) ->
  [add(nth(((I-1) div N) + 1 , Matrix), reverse(getSecond(Matrix2,length(Matrix2), ((I-1) rem N) +1 ), [])) | run(Matrix,Matrix2, I+1, Last-1,N)].

% makes 1d array returned from multiplication into 2d array
splitBack(Answer,LengthOfSplits,LengthOfOriginal,1,J) ->
  [sublist(Answer,J,LengthOfSplits)];
splitBack(Answer,LengthOfSplits,LengthOfOriginal,I,J) ->
  [sublist(Answer,J,LengthOfSplits) | splitBack(Answer,LengthOfSplits, LengthOfOriginal,I-1,J+LengthOfSplits)].

